from hypothesis import given, strategies as st, example
from Cython.Distutils import Extension


@given(
    st.lists(st.text(min_size=1, max_size=10), min_size=1, max_size=3),
    st.booleans(),
)
@example(include_dirs=['0'], pyrex_gdb=False)  # The specific failing case
def test_extension_explicit_cython_with_pyrex_kwarg(include_dirs, pyrex_gdb):
    ext = Extension(
        "test",
        ["test.pyx"],
        cython_include_dirs=include_dirs,
        pyrex_gdb=pyrex_gdb,
    )

    assert ext.cython_include_dirs == include_dirs
    assert ext.cython_gdb == pyrex_gdb


if __name__ == "__main__":
    # Run test with the specific failing example manually
    print("Testing with specific failing input: include_dirs=['0'], pyrex_gdb=False")
    try:
        ext = Extension(
            "test",
            ["test.pyx"],
            cython_include_dirs=['0'],
            pyrex_gdb=False,
        )
        if ext.cython_include_dirs != ['0']:
            print(f"Test FAILED: expected cython_include_dirs=['0'], got {ext.cython_include_dirs}")
        if ext.cython_gdb != False:
            print(f"Test FAILED: expected cython_gdb=False, got {ext.cython_gdb}")
        if ext.cython_include_dirs != ['0'] or ext.cython_gdb != False:
            raise AssertionError(f"Extension attributes don't match: include_dirs={ext.cython_include_dirs}, gdb={ext.cython_gdb}")
        print("Test PASSED (unexpected)")
    except AssertionError as e:
        print(f"Test FAILED with AssertionError: {e}")
